#[test]
fn bindgen_test_layout_sd_image_t() {
    const UNINIT: ::std::mem::MaybeUninit<sd_image_t> = ::std::mem::MaybeUninit::uninit();
    let ptr = UNINIT.as_ptr();
    assert_eq!(
        ::std::mem::size_of::<sd_image_t>(),
        24usize,
        concat!("Size of: ", stringify!(sd_image_t))
    );
    assert_eq!(
        ::std::mem::align_of::<sd_image_t>(),
        8usize,
        concat!("Alignment of ", stringify!(sd_image_t))
    );
    assert_eq!(
        unsafe { ::std::ptr::addr_of!((*ptr).width) as usize - ptr as usize },
        0usize,
        concat!(
            "Offset of field: ",
            stringify!(sd_image_t),
            "::",
            stringify!(width)
        )
    );
    assert_eq!(
        unsafe { ::std::ptr::addr_of!((*ptr).height) as usize - ptr as usize },
        4usize,
        concat!(
            "Offset of field: ",
            stringify!(sd_image_t),
            "::",
            stringify!(height)
        )
    );
    assert_eq!(
        unsafe { ::std::ptr::addr_of!((*ptr).channel) as usize - ptr as usize },
        8usize,
        concat!(
            "Offset of field: ",
            stringify!(sd_image_t),
            "::",
            stringify!(channel)
        )
    );
    assert_eq!(
        unsafe { ::std::ptr::addr_of!((*ptr).data) as usize - ptr as usize },
        16usize,
        concat!(
            "Offset of field: ",
            stringify!(sd_image_t),
            "::",
            stringify!(data)
        )
    );
}
